import Webcam from 'react-webcam';
import React from 'react';
import  {useRef,useState}  from 'react';
function Ff(){
    const[img,setImg]=useState([]);
    const winref=useRef(null);
    function capt(){
        const im=winref.current.getScreenshot();
        setImg(im);
    }
    return(
        <>
        <div className="d2">
            <Webcam audio={false} ref={winref}/>
            <button onClick={capt}>Capture</button>
            {
                im.map((a)=>{
                    <ul><img src={a.img}></img></ul>
                })
            }
        </div>
        </>
    )
}
export default Ff;
